import React from "react";
import "./Input.css";

const Input = ({ message, setMessage, sendMessage }) => {
	return (
		<form className='form'>
			<input
				type='text'
				placeholder='Type a message'
				onChange={e => setMessage(e.target.value)}
			/>
		</form>
	);
};
